import React from 'react';

export default function Movie(props) {
    const {id, title, release_date, popularity, vote_average, overview} = props;
    return (
        <tr>
            <td>{id}</td>
            <td>{title}</td>
            <td>{release_date}</td>
            <td>{popularity}</td>
            <td>{vote_average}</td>
        </tr>
    )
}
